import React, { Component } from "react";
import { Container } from "@material-ui/core";

class Banner extends Component {
  render() {
    return (
      <div className="main-section banner">
        <Container>
          <div className="main-section_content">
            <h1>Blog Single</h1>
          </div>
        </Container>
      </div>
    );
  }
}

export default Banner;
